import React , { useEffect, useState} from 'react';
import Form from './components/Form';
import Weather from './components/Weather';

import './App.css';

const App = () => {

  const APP_KEY = "656c98d724799f2308debe601f2c29b3";
  const exampleReq = `http://api.openweathermap.org/data/2.5/weather?q=London,uk&APPID=${APP_KEY}`;

  const [counter, setCounter] = useState(0);

  useEffect( () => {
    console.log("Effect");
  });



  return (
    <div className="App">
      <h1>Weather-Finder</h1>
      <Form/>
      <Weather/>
      <h1 onClick={() => setCounter(counter + 1)}>{counter} </h1>
    </div>
  );

}

export default App;
